    false,nt"url": null,nt"notes": "This data set consists of Pelagic bird
    sighting data from the Bering Sea and the Gulf of Alaska. These data were collected
    early in the Outer Continental Shelf Environmental Assessment Program (OCSEAP),
    1975 to 1979 on the RV'S DEMERSAL, HOKUSEI MARU, TUSTUMENCA, ALEUTIAN TERN, COMMANDO,
    MILLER FREEMAN, OSHORO MARU, SHAG and THE DISCOVERER. The data were edited by Drs.
    Calvin Lensink and Patrick Gould at the Fish and Wildlife Service office in Anchorage,
    Alaska, and submitted by Nancy Clayton from the University of Rhode Island. The
    data are in NODC file type F033 format.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
